  	residential_planning.thongtindiachi b
  WHERE a.diachi_choohientai_pk = b.pk
  	AND b.phuong_xa_thitran_pk = id_xa;

  SET result = (x / total) * 100 -1;
  SELECT result;
  
END ;;
